// * {
//   box-sizing: border-box;
// }
html {
  // font-size: 100% = 25.60
  font-size: 62.5%;
  font-family: $fontFamily, sans-serif;
  // @include to(250px) {
  //   font-size: 30%;
  // }
  // height: 100%;
  min-height: 100vh;
  // overflow-x: hidden;
  -webkit-tap-highlight-color: transparent;
  scroll-behavior: smooth;

  -webkit-overflow-scrolling: touch;
  overflow-y: auto;
}
body {
  font-weight: 500;
  // line-height: 1.5;
  line-height: initial;
  @include t-(gray-dark);
  text-align: left;
  // line-break: auto;
  font-size: $font-size;
  // background-color: $white;
  // smooth transition--------
  // transition: background 500ms ease-in-out, color 1000ms ease-in-out;
  transition: color 1000ms ease-in-out;

  -webkit-background-size: cover;
  -moz-background-size: cover;
  -o-background-size: cover;
  background-size: cover;

  /* Disable Mobile Webkit Highlights */
  // -webkit-touch-callout: none;
  // -webkit-user-select: none;
  // -khtml-user-select: none;
  // -moz-user-select: none;
  // -ms-user-select: none;
  // user-select: none;
}

*,
*::after,
*::before {
  padding: 0;
  margin: 0;
  outline: 0px solid;
  // box-sizing: border-box;
}

*:hover,
*:active,
*:focus,
*:visited,
*::after:hover,
*::after:active,
*::after:focus,
*::after:visited,
*::before:hover,
*::before:active,
*::before:focus,
*::before:visited {
  outline: 0px solid;
}

img {
  border: 0;
  max-width: 100%;
  max-height: 100%;
  vertical-align: middle;
  display: inline-block;
  object-fit: cover;
}
button {
  color: inherit;
}
table {
  border-collapse: collapse;
  width: 100%;
  // margin-bottom: 10rem;
  overflow-x: auto;
  border-spacing: 0;
  display: table;

  & td,
  & th,
  & {
    padding: math.div($padding, 2);
    // vertical-align: top;
    // border-bottom: 1px solid #dee2e6;
    // border: 2px solid #dee2e6; // all bordered
  }
  & th {
    text-align: center;
    font-weight: $bold;
    // background-color: rgb(231, 231, 231);
  }
  & caption {
    font-weight: $italic;
    font-size: $font-size;
  }
  &.odd tr:nth-child(odd) {
    // background: #dae5f4;
    @include bg-(primary-light);
  }
  &.even tr:nth-child(even) {
    // background: #dae5f4;
    @include bg-(primary-light);
  }
  // & tbody {
  // }
  // & thead {
  // }
}

hr {
  border-style: solid;
}

