//-------------------progress----------------------------------//
progress {
  // vertical-align: baseline;
  width: 100%;
  background-color: rgba(255, 255, 255, 0);

  // &::-webkit-progress-bar {
  //   // background-color: $gray-light;
  //   border-radius: 20px;
  // }
  // &::-moz-progress-bar {
  //   // background-color: $gray-light;
  //   border-radius: 20px;
  // }

  // @include placeholder(progress-bar) {
  //   background-color: var(--primary-dark);
  //   border-radius: 20px;
  // }
}
.progress {
  height: 16px;
  background-color: $gray-light;
  display: flex;
  & *:not(div) {
    justify-self: center;
    align-self: center;
  }
  & > div {
    height: 100%;
  }
}

