//------------------Interpuncts----------------------------------*/
.list-interpunct > li::before {
  content: "・";
  display: inline-block;
  // float: left;
  margin: 0 0 0 -0.9em;
  width: 0.9em;
}

@media (min-width: 992px) {
  .list-interpunct > li::before {
    margin: 0 0 0 -1.5em;
    width: 1.5em;
  }
}

@each $key, $index in $zIndexs {
  .z-#{"" + $key} {
    z-index: $index;
  }
}

/* https://fonts.google.com/ */
@import url($importFont);

@if $importFont2 != none {
  @import url($importFont2);
}

strong {
  font-weight: 700;
}

// ----------------------------
h1,
h2,
h3,
h4,
h5,
h6 {
  // margin-bottom: 0.5rem;
  font-weight: 500;
  // color: var(--title-color);
