h1 {
  font-size: $title; // 2.5rem
}

h2 {
  font-size: $title - 0.5;
}

h3 {
  font-size: $title - 0.75;
}

h4 {
  font-size: $title - 1;
}

h5 {
  font-size: $title - 1.25;
}

h6 {
  font-size: $title - 1.5;
}

//  font 2
.font2 {
  @if $font2 != none {
    font-family: $font2;
  }
