//-------------------container img----------------------------------//
@mixin img-bg($image-src) {
  background-image: url($image-src);
  background-repeat: no-repeat;
  background-size: cover;
  background-position: center;
}

// use case

// .hero {
//   @include cover-background("../image/main.png")
// }
//-------------------container img----------------------------------//
@mixin img-container() {
  overflow: hidden;
  position: relative;
  z-index: $z-normal_1;
  z-index: var(--z-normal);
  & > img:nth-of-type(1) {
    pointer-events: none;
    position: absolute;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    z-index: -1;
    object-fit: cover;
  }
}

/*
  .container-img {
  @include container-img;
  }
*/
//-------------------crop----------------------------------//
@mixin crop() {
  position: relative;
  overflow: hidden;
}
//-------------------crop----------------------------------//
@mixin odd() {
  &:nth-child(odd) {
    @content;
  }
}
@mixin even() {
  &:nth-child(even) {
    @content;
  }
}
//-------------------carousel hover effect----------------------------------//
@mixin carousel() {
  &:hover > * {
    opacity: 0.3;
  }
  &:hover > *:hover {
    opacity: 1;
    transform: scale(1.5);
  }
  & > * {
    // transform-origin: center left;
    transition: 450ms;
  }
}

//-------------------card----------------------------------//
@mixin img-url($var) {
  background: url($var);
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
}

/*
  .img-url {
    @include container-img("aqui.com");
  }
*/
//-------------------card----------------------------------//
@mixin card-f($flex: false) {
  width: 100%;
  overflow: hidden;
  border-collapse: collapse;
  @content;
  @if $flex {
    display: flex;
    flex-direction: column;
    justify-content: space-between;
  }
}

//-------------------no select text----------------------------------//
@mixin noSelectText {
  -webkit-touch-callout: none; /* iOS Safari */
  -webkit-user-select: none; /* Safari */
  -khtml-user-select: none; /* Konqueror HTML */
  -moz-user-select: none; /* Old versions of Firefox */
  -ms-user-select: none; /* Internet Explorer/Edge */
  user-select: none; /* Non-prefixed version, currently supported by Chrome, Edge, Opera and Firefox */
}

//-------------------pseudo----------------------------------//
@mixin pseudo($position: absolute, $content: "", $display: block) {
  content: $content;
  display: $display;
  @content;
  @if $display {
    position: $position;
  }
}

//-------------------before----//
@mixin before($position: absolute, $content: "", $display: block) {
  &::before {
    @include pseudo($position, $content, $display) {
      @content;
    }
  }
}

//-------------------after-----//
@mixin after($position: absolute, $content: "", $display: block) {
  &::after {
    @include pseudo($position, $content, $display) {
      @content;
    }
  }
}
