//-------------------flex----------------------------------//
@mixin flex-dcia(
  $flex-direction: row,
  $justify-content: space-between,
  $align-items: false,
  $justify-items: false,
  $align-content: false,
  $flex-wrap: wrap,
  $flex: flex
) {
  display: $flex;
  flex-direction: $flex-direction;
  justify-content: $justify-content;
  @if $align-items {
    align-items: $align-items;
  }
  @if $justify-items {
    justify-items: $justify-items;
  }
  @if $align-content {
    align-content: $align-content;
  }
  flex-wrap: $flex-wrap;
  @content;
}
@mixin flex-item(
  $order: initial,
  $flex-basis: content,
  // $flex: auto,
    $flex-grow: 0,
  $flex-shrink: 1
) {
  order: $order;
  flex-basis: $flex-basis;
  // flex: $flex;
  flex-grow: $flex-grow;
  flex-shrink: $flex-shrink;
  @content;
}
