  height: 32px;
  left: 0;
  line-height: 32px;
  padding: 0 15px;
  position: absolute;
  text-shadow: 0 1px 1px hsla(0, 0%, 0%, 1);
  white-space: nowrap;
  -webkit-border-radius: 5px;
  -moz-border-radius: 5px;
  -o-border-radius: 5px;
  border-radius: 5px;
}
.tooltip[data-tooltip]:hover:after {
  display: block;
  top: -9px;
}
.tooltip[data-tooltip]:hover:before {
  display: block;
  top: -41px;
}
