//------------------slider input----------------------------------*/
%switch {
  position: relative;
  display: inline-block;
  // font-size: 20px;
  width: 3.5em;
  height: 1.6em;
  font-size: 15px;
}
.switch,
.switch-center {
  @extend %switch;
  &::after,
  &::before {
    content: "";
  }
  & input:checked + .slider,
  & input:checked + .slider-round {
    background-color: Var(success);
    // background: linear-gradient(
    //   291deg,
    //   rgba(51, 245, 108, 1) 0%,
    //   rgba(40, 167, 69, 1) 100%
    // );
  }

  & input:checked + .slider:before,
  & input:checked + .slider-round:before {
    -webkit-transform: translateX(1.9em);
    -ms-transform: translateX(1.9em);
    transform: translateX(1.9em);
  }
  & input {
    opacity: 0;
    width: 0;
    height: 0;
  }

  & input:checked ~ .label-on {
    opacity: 1;
  }
  & input:checked ~ .label-off {
    opacity: 0;
  }
}
.switch-center {
  display: block;
  @include mx-(auto);
}

// ------
%slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  -webkit-transition: 0.4s;
  transition: 0.4s;
  transition: background-color 0.4s;
  background-color: Var(danger);
}
%slider-before {
  position: absolute;
  content: "";
  background-color: white;
  -webkit-transition: transform 0.4s ease-out;
  transition: transform 0.4s ease-out;
  height: 1.3em;
  width: 1.3em;
  left: 0.15em;
  top: 0.15em;
}

.slider {
  @extend %slider;

  &-round {
    @extend %slider;
    border-radius: 1em;
    &:before {
      border-radius: 1em;
      @extend %slider-before;
    }
  }

  &:before {
    @extend %slider-before;
  }
}

// -----
.label {
  &-on,
  &-off {
    position: absolute;
    line-height: 100%;
    top: 0.52em;
    color: white;
    // transition: opacity 0.4s ease;
    font-size: 0.8em;
  }
  &-on {
    left: 10%;
    // transform: translate(0%, -50%);
    opacity: 0;
  }
  &-off {
    right: 10%;
    // transform: translate(0%, -50%);
  }
}

/*
