@mixin marginData($mop, $direccion) {
  @each $dir in $direccion {
    #{$mop}-#{$dir}: $margin;
  }

  @for $value from 2 through 10 {
    &-#{ $value} {
      @each $dir in $direccion {
        #{$mop}-#{$dir}: math.div($margin, $value);
      }
    }
  }
