    @each $dir, $short in $directions {
      &#{$short} {
        padding-#{$dir}: $padding;
        @include increase(padding-#{$dir}, $padding, 0);
        &-auto {
          padding-#{$dir}: auto;
        }
      }
    }

    &x {
      @include marginData("padding", $x);
    }

    &y {
      @include marginData("padding", $y);
    }
    //-----------------------------------------------------//
    &-0 {
      @include erasebreakpoints(padding, none);
    }
  }
}

