@for $var from 1 to 6 {
  .h#{$var} {
    @extend h#{$var};
  }
}
//-------------------font style----------------------------------//
.t {
  @each $value in $font-style {
    &-#{$value} {
      font-style: $value;
    }
  }
}
//-------------------letter spacing----------------------------------//
.t-space {
  @each $value in $letter-spacing {
    &-#{$value} {
      letter-spacing: $value;
    }
  }
  @for $value from 0 to 10 {
    &-#{$value} {
      letter-spacing: $value * 1px;
    }
  }
}
//------------------transparent----------------------------------*/
.t-transparent,
.t-t {
  color: transparent;
}
//-------------------text color----------------------------------//
.t {
  @include breakpointMaker {
    @each $key, $value in $colors {
      &-#{"" + $key} {
        @include t-($key);
        &-hover:hover {
          @include t-($key);
        }
      }
    }
  }
}

//-------------------font weight----------------------------------//
.bold,
.t-bold {
  @include breakpointMaker {
    font-weight: bold;
  }
}
//-------------------font size----------------------------------//

.t {
  @each $key, $value in $fontSizes {
    @include breakpointMaker {
      &-#{"" + $key} {
        font-size: $value;
      }
    }
  }
  // ------
  @for $i from 1 through 20 {
    @include breakpointMaker(true) {
      &-#{$i} {
        font-size: math.div(($i * 4rem), 5);
      }
    }
  }
}
